import { BrowserRouter as Router, Routes, Route,  } from "react-router-dom";

import "./App.css";
import Navbar from "./Komponensek/Navbar/Navbar";
import Fooldal from "./Komponensek/Oldalak/Fooldal";
import Signup from "./Komponensek/Oldalak/Signup";
import Etlap from "./Komponensek/Oldalak/Etlap";
import Rendeles from "./Komponensek/Oldalak/Rendeles";
import Kapcsolat from "./Komponensek/Oldalak/Kapcsolat";
import Login from "./Komponensek/Oldalak/Login";
import Termek from "./Komponensek/Oldalak/Termek";
import EtlapKontextusEllato from "./Kontextus/Etlap-kontextus";



function App() {
  return (
    <div className="App">

      <EtlapKontextusEllato>
      <Router>
        <Navbar />
        <Routes>
          <Route path="/fooldal" element={<Fooldal/>}/>
          <Route path="/etlap" element={<Etlap/>} />
          <Route path="/rendeles" element={<Rendeles/>}/>
          <Route path="/signup" element={<Signup />}/>
          <Route path="/kapcsolat" element={<Kapcsolat/>}/>
          <Route path="/login" element={<Login/>}/>
          <Route path="/termekek" element={<Termek/>}/>
        </Routes>

        </Router>
      </EtlapKontextusEllato>
    </div>
  );
}

export default App;
